#DEFCON_BEGIN
#!/bin/bash #<--- Leave shebang here so defcon file will have it as 1st line.
#varkey-------------------------------------------------------------------------
# BDIR .......... BUILT-IN FREECANS DIRECTORY
# CCMD .......... COPY COMMAND
# CHAIND ........ WATCHER VARIABLE
# CMD_LN ........ GLOBAL COMMAND LINE HOLDER
# DOCDIR ........ DOCUMENTATION DIRECTORY
# DST ........... DESTINATION
# ENAM .......... EXECUTION NAME
# ET ............ PARALLEL CONNECTION EXTENSION
# EXCT .......... ID FLUSH VARIABLE
# FDIR .......... SHARED FUNCTIONS DIRECTORY
# FNM ........... PARALLEL COLLECTION FILENAME
# GEOX .......... X COORDINATE HOLDER
# GEOY .......... Y COORDINATE HOLDER
# HGDR .......... COLLECTION DIRECTORY
# GOINST ........ LOCAL INSTALL VARIABLE
# HYP ........... HYPER-SPEED COMMAND
# IDIR .......... INSTALLATION DIRECTORY
# IWRD .......... LOCAL INSTALLATION VARIABLE
# KSCN .......... SSH KEY SCAN COMMAND
# KSCL .......... SLOW SSH KEY SCAN COMMAND
# KEYTYPE ....... TYPE OF SSH KEY
# KEYGENCMD ..... KEY GENERATION COMMAND
# KWNH .......... LOCAL SSH KNOWN HOSTS FILE
# LDIR .......... LIBRARY DIRECTORY
# MDIR .......... WORKING DIRECTORY
# MENV .......... CLASS C NETWORK ENVIRONMENT
# MLST .......... MASTER LIST
# MNAM .......... FRAMEWORK INSTALLER
# MPLD .......... HTK STANDARD PAYLOAD TAG
# MVL ........... INSTALLED SCRIPT
# PDIR .......... PRECAN DIRECTORY
# PNAM .......... SOFTWARE PACKAGE NAME
# PLUSH ......... SYSTEM-WIDE PLUSH PROFILE
# QSCMD ......... HYPER RSYNC COMMAND
# SCREENCOUNT ... PARALLEL KEY COPY SCREEN COUNTER
# SRC ........... SOURCE
# SSCMD ......... SERIAL RSYNC COMMAND
# TCMD .......... TUNNEL COMMAND
# THSBL ......... LOCAL BOOLEAN VARIABLE
# USR ........... REMOTE USER
# WRLDZ ......... WAKE-ON-LAN NICS
# XCMD .......... TUNNELED X COMMAND

#globvars-----------------------------------------------------------------------
DN=/dev/null
MENV=10.0.0
MY_SSH_PORT="-p 22"
MY_SCP_PORT="-P 22"
TCMD="ssh $MY_SSH_PORT -2"
XCMD="ssh $MY_SSH_PORT -2 -X"
CCMD="scp $MY_SCP_PORT -r -2"
HGDR=get.$$
KEYTYPE=rsa
KEYGENCMD="ssh-keygen -t $KEYTYPE -P '' -f ~/.ssh/id_${KEYTYPE}"
KSCN="ssh-keyscan $MY_SSH_PORT -t rsa1,dsa,rsa -T 10 -f"
KSCL="ssh-keyscan $MY_SSH_PORT -t rsa1,dsa,rsa -T 5"
KWNH=~/.ssh/known_hosts
ENAM=$0
MNAM=$(basename $ENAM)
MDIR=/var/lib/hyperf
LDIR=$MDIR/lib
MLST=$MDIR/master.list
PDIR=$LDIR/precans
BDIR=$LDIR/freecans
FDIR=$LDIR/funcs
PLUSH=bash.bashrc.local
DHPRF=~/.hyperf
PBFL=$DHPRF/$PLUSH.pre-install.backup
BRCP=$DHPRF/dot.bashrc__pre-boost.backup
VRCP=$DHPRF/dot.vimrc__pre-boost.backup
test -e /etc/init.d/sysresccd -a -e /mnt/cdrom/sysrcd.dat && PLUSH=bash/bashrc
test -e /etc/init.d/sysresccd -a -e /etc/gentoo-release && PLUSH=bash/bashrc
test -e $FDIR/plush.fnc && . $FDIR/plush.fnc
WRLDZ=$(IP 2>$DN|cut -d\. -f1-3|sed 's/$/.0/')
SRC=$1
DST=$2
USR=root
HYP="screen -d -m"
#SSCMD="rsync --inplace -HIAXPav -e ssh --delete"
SSCMD="rsync -SHIAXPav -e ssh --delete"
#QSCMD="rsync --inplace -HIAXa   -e ssh --delete"
QSCMD="rsync -SHIAXa   -e ssh --delete"
IDIR=/root/bin
MVL=$IDIR/htk.sh
MPLD=HYPERF_0
#DEFCON_END

#funcs-------------------------------------------------------------------------
back_up_pre_existing_hyperf_libs_and_docs (){
   #Takes no args.
   #
   #Self explanatory.
   if [ -d $LDIR/common -o -d $DOCDIR ] ; then
      tell_us_what_you_do
      tar -zcf /var/lib/hyperf.$$.bak.tgz $MDIR/lib $DOCDIR 2>$DN
   fi
}
check_for_existing_install_collision__or__set_management_action (){
   #Takes 1 arg:        Arg 1 is management action
   #                    Arg 1 can be either 'ins' or 'upg'
   #
   if [ $1 = ins ];then
      if [ -x $MVL ];then
         echo "--------------------------------------------------"
         echo "$MVL APPEARS TO BE ALREADY INSTALLED"
         echo "--------------------------------------------------"
         echo "--------------------------------------------------------"
         echo "EXECUTE 'htk.sh --upg' TO RE-LINK, REINSTALL, or UPGRADE"
         echo "--------------------------------------------------------"
         echo Exiting ; exit
      fi
      IWRD=INSTALL
   elif [ $1 = upg ];then
      IWRD=UPGRADE
   fi
}
copy_kit_to_root_bin__then_install__or__update_command_links_there (){
   #Takes no args
   #
   tell_us_what_you_do
   #
   #Copy kit to root bin...
   cp $ENAM $MVL 2>$DN
   #
   #Install or update command links...
   ol_ul_prompt - "EXECUTING $IWRD OF COMMAND LINKS IN $IDIR/"
   chmod +x $MVL
   pushd $IDIR 2>&1 >$DN
   for f in $(cat $MVL|grep -E "\<(h|n|s|x)\.[^ ]*\)" htk.sh|grep -v grep |tr -d ")") ; do
      cp -fl $MVL $f
   done
   #
   #Purge dead links...
   ol_ul_prompt - "PURGING DEAD LINKS IN $IDIR/"
   for d in $(ls [mhnsx].*|xargs -i basename {});do
      grep "$d" $MVL >$DN || rm $d
   done
   popd 2>&1 >$DN
}
create_installation_and_documentation_directories_by_os_type (){
   #Takes no args.
   #
   #Self explanatory.
   set_docdir_by_os_type
   mkdir -p $IDIR $DOCDIR
}
display_management_action (){
   #Takes no args.
   #
   #Displays the management action being taken.
   #
   ol_ul_prompt = $IWRD
}
extract_yolk_by_pattern_1__from__file_2 (){
   # Takes 2 args:      1 is unique yolk (payload) name suffix
   #                    2 is name of FILE to extract yolk from
   #
   # What this function does:
   # This is the primary extractor function of the payload.  It extracts a yolk
   # (i.e. an embedded payload) from a file, based on a pattern provided to it
   # as an argument.  It looks for a beginning and ending delineator lines
   # for the payload, and uses 'cat', 'sed', and 'tail' to output just the lines
   # between those delineators.
   #
   # The patterns that delineate the yolk must contain 'BEGIN_YOLK_' and
   # 'END_YOLK_', respectively.
   # Example beginning delineator: BEGIN_YOLK_HYPERF_0
   # Example ending    delineator:   END_YOLK_HYPERF_0
   #
   # Notice how the single pattern 'HYPERF_0' can then delineate the start and
   # end of a yolk.
   #
   # A file can contain multiple yolks, as long as the delineators are unique in
   # the file.
   #
   # Each payload is required to be base64 encoded.
   #
   # This function outputs the decoded stream on standard out (stdout).
   #
   # Any other command that can receive stdin can take the stream and deal with
   # it.  So, a base64 encoded tarball can be embedded inside a script, for
   # example.
   #
   # How the code works:
   # 1. The 'cat' line, below, streams the file...
   # 2. The 1st 'sed' command filters the stream down to only the lines between
   #    STRING1 and STRING2, which delineate the yolk.
   # 3. The 2nd 'sed' command trims out the ending delineator line from the
   #    stream.
   # 4. The 'tail' line trims out the first delineator line from the stream.
   # 5. The 'openssl' command base64-decodes the stream
   #
   local STRING1=^#BEGIN_YOLK_${1}
   local STRING2=^#END_YOLK_${1}
   #Return error if incorrect number of args
   if [ $# -ne 2 ] ; then
      EE=33
      echo "Wrong number of arguments."
      echo "You must provide a yolk suffix name and file to extract from."
      return $EE
   fi
   #Extract the desired yolk from the target file
   cat $2 | \
   sed -n "/${STRING1}/,/${STRING2}/p" | \
   sed -n '$!p' | \
   tail -n+2  | \
   openssl base64 -d
}
handle_the_full_auto__plush__cqt__and__grouper__bits (){
   #Takes no args.
   #
   #Auto-creates backups,
   case $FULLAUTO in
      yes)
         mkdir -p $DHPRF
         if [ -e /etc/$PLUSH ] ; then
            cp -n /etc/$PLUSH $PBFL.orig
         fi
         cp $BDIR/plush.profile /etc/$PLUSH
         bash $BDIR/cqt.sh
         bash $BDIR/grouper.sh
         ;;
   esac
}
htk_mgmt_action (){
   #Takes 1 arg:        Arg 1 is installation type to perform
   #                    Arg 1 can be either 'ins' or 'upg'
   case $FULLAUTO in
      yes)
         local DELAY20=0
         local DELAY10=0
         ;;
      *)local DELAY20=20
        local DELAY10=10
        ;;
   esac
   check_for_existing_install_collision__or__set_management_action $1
   display_management_action
   test_for_os_type_and_set_appropriately
   ol_ul_prompt = $OS_TYPE
   create_installation_and_documentation_directories_by_os_type
   copy_kit_to_root_bin__then_install__or__update_command_links_there
   set_up_ssh
   back_up_pre_existing_hyperf_libs_and_docs
   prompt_to_tap_enter_or_this_many_second_continue $DELAY10
   #############################################################################
   # NOTE: Do *NOT* set $DELAY10, just above, to a static value, because it may
   #       need to be zero'ed out by the full-auto installation process.
   #############################################################################
   install_or_upgrade_the_hyperf_payload
}
install_or_upgrade_the_hyperf_payload (){
   #Takes no args.
   #Self explanatory.
   #
   pushd /tmp 2>&1 >$DN
   echo
   ol_ul_prompt - "EXECUTING $IWRD OF HYPERF PAYLOAD:"
   extract_yolk_by_pattern_1__from__file_2 $MPLD $MVL | tar --no-overwrite-dir -zxf - -C / 2>$DN
   case $OS_TYPE in
      mac)
         #Perform special mac documentation installation
         extract_yolk_by_pattern_1__from__file_2 $MPLD $MVL | tar --wildcards -zxf - -C /opt usr/* 2>$DN
         ;;
   esac
   #Fix ownership and permissions 
   chown -R root.root $DOCDIR $MDIR 2>$DN
   chmod a=r $BDIR/*
   echo
   echo
   install_or_upgrade_plush
   parse_htk_functions_and_export_to__hyperf_fnc__file
   install_or_upgrade_the__plush__exported_library_files
   indicate_that_the_install_or_upgrade_is_complete
   handle_the_full_auto__plush__cqt__and__grouper__bits
}
install_or_upgrade_plush (){
   #Takes no args.
   #Self explanatory.
   #
   echo "Would you like to $IWRD the PLUSH profile?"
   echo "Type $IWRD, if yes. [Def=no in 20 secs]"
   read -t $DELAY20 GOINST
   test -z $THSBL 2>$DN && THSBL=no
   if [ $GOINST = $IWRD ] 2>$DN ; then
      ol_ul_prompt - "EXECUTING $IWRD OF PLUSH PROFILE:"
      cp $BDIR/plush.profile /etc/$PLUSH
      sed -i "s@plush=[[:graph:]].*\>@plush=/etc/$PLUSH@g" /etc/$PLUSH
   else
      echo "In case you want to install it later,"
      echo "you can find plush in $BDIR"
   fi
}
install_or_upgrade_the__plush__exported_library_files (){
   #Takes no args.
   #
   #Self explanatory.
   if [ ! -e $FDIR/plush.fnc -o ! -e $FDIR/plush_a2v -o $IWRD = UPGRADE ];then
      ol_ul_prompt - "EXECUTING $IWRD OF EXPORTED PLUSH LIBRARIES:"
      #Plush was installed above, so source it in to use some of its functions
      . $BDIR/plush.profile
      #Put a shebang at the beginning of exported plush.fnc file.
      echo "#!/bin/bash"                                             > $FDIR/plush.fnc
      #Export plush functions.
      bgrep "^\#funcs" "^#changelog" $BDIR/plush.profile |head -n-1 >> $FDIR/plush.fnc
      #Dump out the comment header of the plush_a2v file
      plush_a2v_comments > $FDIR/plush_a2v
      #Convert plush aliases to a variables lib and dump the plush_a2v file
      plush_alias_2_vars >> $FDIR/plush_a2v
      chown root.root $FDIR/{hyperf,plush}.fnc $FDIR/plush_a2v
      chmod 444 $FDIR/{hyperf,plush}.fnc $FDIR/plush_a2v
   else
      #Don't upgrade the payload. Instead, dump it to tmp and inform the user.
      extract_yolk_by_pattern_1__from__file_2 $MPLD $MVL > /tmp/payload.tgz
      echo "I found previously installed hyperf components,"
      echo "but the --UPGRADE option was not used."
      read -t 1
      echo "I do not want to overwrite the originals."
      read -t 1
      echo "I am Extracting payload.tgz to /tmp/ :"
      read -t 1
      echo "Manual extraction of the payload will be required,"
      echo "or you can re-run htk.sh with the --UPGRADE option"
      echo "--------------------------------------------------"
   fi
}
indicate_that_the_install_or_upgrade_is_complete (){
   #Takes no args.
   #
   #Self explanatory.
   ol_ul_prompt - "HYPERF FRAMEWORK $IWRD COMPLETE"
}
ol_ul_prompt (){
   #Takes 1-N args:    Arg 1 is character with which to overline/underline
   #                   Args 2-N are strings of words that make up a prompt
   #                   (prompt will be overlined, diplayed, and underlined)
   #
   local C=$1
   shift
   local L="$(echo $@ | sed "s/./$C/g")"
   echo $L
   echo $@
   echo $L
}
parse_htk_functions_and_export_to__hyperf_fnc__file (){
   #Takes no args.
   #
   #Self explanatory.
   #
   if [ ! -e ${FDIR}/hyperf.conf -o ! -e ${FDIR}/mui.conf -o $IWRD = UPGRADE ] ; then
      ol_ul_prompt - "EXECUTING $IWRD OF HYPERF FUNCTION LIBRARY:"
      mkdir -p $FDIR
      . $BDIR/plush.profile
      #Put a shebang at the beginning of the hyperf.fnc file.
      echo "#!/bin/bash"               > $FDIR/hyperf.fnc
      bgrep "^\#funcs" "^\#main" $MVL >> $FDIR/hyperf.fnc
   fi
}
prompt_to_tap_enter_or_this_many_second_continue (){
   #Takes 1 arg:        Arg 1 is delay
   #Self explanatory
   #
   read -t $DELAY10 -p "(Continues in 10 seconds or tap Enter)"
}
set_docdir_by_os_type (){
   #Takes no args.
   #
   #Self explanatory.
   case $OS_TYPE in
      mac) DOCDIR=/opt/usr/share/doc/packages/hyperf ;;
      cygwin|linux) DOCDIR=/usr/share/doc/packages/hyperf ;;
   esac
}
set_up_ssh (){
   #Takes no args.
   #
   #Self explanatory.
   tell_us_what_you_do
   if [ ! -e ~/.ssh/id_${KEYTYPE} ] ; then
      mkdir -p ~/.ssh
      chown $USER ~/.ssh
      chmod 0700 ~/.ssh
      eval $KEYGENCMD
   fi
}
tell_us_what_you_do (){
   local LINE1="$(echo ${FUNCNAME[1]} | \
                  tr '_' ' ' | \
                  sed 's/^\(.\)/\U\1/g;s/$/./g'
                 )"
   ol_ul_prompt - $LINE1
}
test_for_os_type_and_set_appropriately (){
   #Takes no args.
   #
   #Self explanatory.
   #
   tell_us_what_you_do
   cON
   #Set OS_TYPE to MacOS, Cygwin, or Linux
   if [[ $OSTYPE =~ darwin ]] ; then
      OS_TYPE=mac
      return
   elif [[ $MACHTYPE =~ darwin ]] ; then
      OS_TYPE=mac
      return
   elif [[ $OSTYPE =~ apple ]] ; then
      OS_TYPE=mac
      return
   elif [[ $MACHTYPE =~ apple ]] ; then
      OS_TYPE=mac
      return
   elif [[ $OSTYPE =~ cygwin ]] ; then
      OS_TYPE=cygwin
      return
   elif [[ $MACHTYPE =~ cygwin ]] ; then
      OS_TYPE=cygwin
      return
   else
      OS_TYPE=linux
      return
   fi
   cOFF
}

attach_to_screens (){
   for x in $(screen -ls |grep Detached|awk '{print $1}') ; do
      screen -r $x
   done
}
chaind (){
   CHAIND=1
   until [ $CHAIND = 0 ] ;do
      CHAIND=$(screen -ls |grep -i \(Detached\)|grep -v grep|wc -l)
      sleep .5
   done
}
cOFF (){
   shopt -u nocasematch
}
cON (){
   shopt -s nocasematch
}
copy_ids (){
   ssh-copy-id -i ~/.ssh/id_$KEYTYPE.pub $USR@$i 2>&1 >$DN
}
completely_purge_hyperf_from_system (){
   test_for_os_type_and_set_appropriately
   g.uninstall_grouper 2>$DN
   c.uninstall_cluster_tools.sh 2>$DN
   pushd $IDIR &>$DN
   find -samefile $MVL |grep -v $(basename $MVL) |xargs -i rm {}
   popd &>$DN
   local f=$BDIR/exo.shell         ; test -e $f && bash $f --uninstall
   local f=$IDIR/___mobile_home.sh ; test -e $f && rm $f
   local f=~/.hyperf/bins.list     ; test -e $f && rm $f
   set_docdir_by_os_type
   rm -rf $IDIR/{cqt,grouper}.sh /etc/defcon $DOCDIR $MVL $MDIR*
   rmdir $IDIR &>$DN 
   # Restore any available backups
   if [ -e $PBFL.orig ] ; then
      mv $PBFL.orig /etc/$PLUSH
      chown root.root /etc/$PLUSH
      chmod 0644 /etc/$PLUSH 
   fi
   if [ -e $BRCP.orig ] ; then
      mv $BRCP.orig ~/.bashrc
      chown $USER ~/.bashrc
      chmod 0644 ~/.bashrc
   fi
   if [ -e $VRCP.orig ] ; then
      mv $VRCP.orig ~/.vimrc
      chown $USER ~/.vimrc
      chmod 0644 ~/.vimrc
   fi
   rmdir $DHPRF
}
defcon (){
   # Takes 1-to-4 args: 1 (Rqrd) is the DEFCON config filename
   #                    -----------------------------------------------------
   #                    2 (Opt) is '--personald': use a personal DEFCON_FILE
   #                    -----------------------------------------------------
   #                    3 (Opt) is "--editd": Edit the DEFCON_FILE, then exit
   #                    4 (Opt) is "[SEARCH STRING]": append to the '--editd'
   #                                                  option; Vim will jump to
   #                                                  that SEARCH STRING
   #                                                  location in DEFCON_FILE.
   # ------------------------
   # Description of defcon():
   # ------------------------
   # This function allows a calling script (parent) to carry around its own
   # default configuration, rather than having to use an external package
   # manager to provide it a default configuration file.  If the parent's code
   # *DOES* call defcon(), it does not preclude the use of an external package
   # manager to provide said default configuration file for the parent, it
   # simply gives the parent the *OPTION* of not having to depend on such a
   # package manager...if desired. 
   #
   # A 1st-run of the script essentially acts like an installation of the
   # default configuration to a file in a standard location.  If the
   # '--personald' option is provided to this function, the location of that
   # defcon file is in ~/.defcon/ directory.  Otherwise, the location of the
   # default configuration is in the standard /etc/defcon/ directory.  If the
   # '--editd' option is provided to the script, then defcon will open the
   # Defcon file for editing, then will cause the parent script to completely
   # exit -- i.e. completely terminate execution.
   #
   # -------------------------------------
   # Full Description of the Defcon System
   # -------------------------------------
   # defcon() is one of the handiest functions in HyPerf.  Many scripts in the
   # HTK use it to provide for their default configuration.
   #
   #
   # (The following comments show examples of use of this function [defcon()],
   # explain how it works, and explain its options and arguments.
   #
   # =======================
   # Example Usages (Quick):
   # =======================
   # defcon  parent.conf
   # defcon  parent.conf  $@
   # defcon  parent.conf  --editd  $@
   # defcon  parent.conf  --editd  EXAMPLE_JUMP=mysetting  $@
   # defcon  parent.conf  --personald  $@
   # defcon  parent.conf  --editd  --personald  $@
   # defcon  parent.conf  --personald  --editd  $@
   # defcon  parent.conf  --editd EXAMPLE_JUMP=mysetting  $@
   # defcon  parent.conf  --personald  --editd  $@
   # defcon  parent.conf  --personald  --editd EG_SETG=eg_value  $@
   #
   # ============================
   # Example Usage Explained (1):
   # ============================
   # ┌┬┬┬┬┬───────────────← Calling defcon()
   # ││││││  ┌┬┬┬┬┬┬┬─────← Name of this script's DEFCON_FILE in /etc/defcon/
   # ││││││  ││││││││  ┌┬─← All Remaining options (2-N) passed to this function
   # ↓↓↓↓↓↓  ↓↓↓↓↓↓↓↓  ↓↓
   # --------------------
   # defcon  htk.conf  $@
   # --------------------
   #
   # ============================
   # Example Usage Explained (2):
   # ============================
   # ┌┬┬┬┬┬────────────────────────────← Calling defcon()
   # ││││││
   # ││││││  ┌┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬┬← Dynamically determined DEFCON_FILE name
   # ││││││  ││││││││││││││││││││││││││  to match executable name
   # ││││││  ││││││││││││││││││││││││││
   # ││││││  ││││││││││││││││││││││││││  ┌┬┬┬┬┬┬┬┬┬┬─────← Use 'personal' mode
   # ││││││  ││││││││││││││││││││││││││  │││││││││││
   # ││││││  ││││││││││││││││││││││││││  │││││││││││  ┌┬─← All Remaining options
   # ││││││  ││││││││││││││││││││││││││  │││││││││││  ││   (2-N) passed on to
   # ↓↓↓↓↓↓  ↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓  ↓↓↓↓↓↓↓↓↓↓↓  ↓↓   defcon()
   # ---------------------------------------------------
   # defcon  $(basename -s .sh $0).conf  --personald  $@
   # ---------------------------------------------------
   #
   # How defcon() works:
   # -------------------
   # When defcon() is called, it is provided a configuration filename as its
   # 1st argument.
   #
   # That file is called the parent's 'DEFCON_FILE'.
   #
   # Defcon() checks for the DEFCON_FILE in either the default /etc/defcon/
   # directory (standard mode) or the ~/.defcon/ directory (personal mode).
   #
   # If its 1st argument is found, then defcon() sources that file into the
   # parent script.  If the indicated file is *NOT* found, then defcon() parses
   # the parent script for all settings (and code) that it can find between the
   # beginning tag "#DEFCON_BEGIN" and the ending tag "#DEFCON_END".
   #
   # It then copies the parsed settings to the 1st argument.
   #
   # The 1st execution of a parent (that sources and correctly calls this
   # function) essentially acts as an installation of that parent's DEFCON_FILE
   # to either the system or the personal location, depending on the calling
   # options.
   #
   # Subsequent executions of that same parent will read the settings
   # (i.e. source them) from that DEFCON_FILE into the parent, overriding any
   # matching settings in the parent.
   #
   # ---------------------------------------------------------------------------
   # NOTE: The aforementioned tags must both be located at the beginning of
   #       their respective lines in order for defcon() to parse their included
   #       settings correctly.
   #
   #       Generally, those tags can (and should) be found in the global
   #       variables section at the start of scripts that follow the HyPerf
   #       coding methodology.
   # ---------------------------------------------------------------------------
   #
   # Any settings, found in the parent script but not existing in the
   # DEFCON_FILE, will be set for the parent,  as they are defined in the parent
   # script.  This has the effect of allowing an upgraded script to add settings
   # in the parent, while previous customizations from a pre-existing
   # DEFCON_FILE still affect the parent.
   #
   # Administrators should make changes to the desired DEFCON_FILE of a parent
   # script and those settings will take affect when the parent script is
   # executed.  Administrators should *NOT* change the settings in the parent
   # script itself.
   #
   # Including a DEFCON_FILE in a software package will have the same affect as
   # an installation would, so scripts that use defcon() can still be packaged
   # as normal in RPM, DPKG, make, tarballs, etc.
   #
   # Arguments:
   # ----------
   # 1. The Defcon File (required):
   #    ---------------------------
   #    The first argument to defcon() is required and is the DEFCON_FILE.
   #
   #    See the usage examples, above, for ideas on how to creatively pass the
   #    config filename to defcon() so that it will automatically set a desired
   #    name, based on the name of the executable.
   #
   #    ------------------------------------------------------------------------
   #    TIP: Links can be used to have different configurations for the same
   #         base script, for example.
   #    ------------------------------------------------------------------------
   #
   #
   # 2. Personal Mode: (--personald)
   #    --------------
   #    Personal mode is set by passing the '--personald' option to defcon().
   #    It takes no option arguments.  If this option is used, defcon() will set
   #    the directory for defcon configurations for the parent to ~/.defcon/.
   #
   #    This mode should be used by parent scripts that are not meant to be
   #    executed system-wide, but a DEFCON_FILE is still desirable.
   #
   #
   # 3. Edit Mode: (--editd)
   #    ----------
   #    Defcon is sensitive to the '--editd' long option (no option argument).
   #    The parent script can pass all the command line arguments to defcon()
   #    and it can parse them for any instance of '--editd'.
   #
   #    If defcon() detects that '--editd' has been passed to it, it will
   #    perform all of its other standard functions, with the exception that
   #    instead of sourcing the DEFCON_FILE into the parent, it will open it in
   #    Vim for editing.
   #
   #    Edit mode allows defcon() to be used as an installer and instant editor
   #    of the DEFCON_FILE.  Rather than having to first find and then
   #    subsequently edit the DEFCON_FILE, the user of the parent script can
   #    provide the '--editd' option to it and defcon() will automatically open
   #    up for editing.
   #
   #    This is exceptionally handy for rapid configuration.
   #
   #
   # 4. Jump mode: (--editd [SEARCH STRING]    <-- Jump into the defcon file for
   #                                               quick editing
   #    ----------
   #    This mode is simply an extension to edit mode:  When calling defcon()
   #    with the '--editd' option, a (single) trailing string can be provided to
   #    defcon() to allow the user to jump to the 1st occurance of that string
   #    in the DEFCON_FILE.  If *anything* is found trailing the '--editd'
   #    option, it will be considered a search strings and the first word will
   #    be used for the jump.
   #
   #    Jump editing can make changing of a common settings much quicker.
   #
   #    -----------------------------------------------------------------
   #    CAVEAT: Defcon() only supports a single jump per editing session.
   #    -----------------------------------------------------------------
   #
   #
   # ---------------------------------------------------------------------------
   # NOT A TYPO: There is a trailing lowercase letter 'd' on each of the
   #             '--personald' and '--editd' long-options.
   #
   #             Defcon() will ignore similar options without the trailing 'd'.
   # ---------------------------------------------------------------------------
   #
   local S      # Defcon source script
   local F      # Defcon configuration file
   local D      # Defcon directory
   local P      # Defcon pattern
   local V      # Vimsearch pattern provided with '--editd' option
   #
   S=$0           #Defcon source
   test -z $1 && (echo "Missing DEFCON filename.  Exiting"
                  exit
                 )
   P="^#DEFCON_(BEGIN|END)"
   #Set defcon mode:
   case "$@" in
      *--personald*)
         #Set 'personald' mode
         D=~/.defcon
         set -- $(echo $@ | sed 's/--personald//g')
         ;;
      *)
         D=/etc/defcon
         ;;
   esac
   #Set defcon configuration file path:
   F=${D}/${1}
   #Parse the options passed to this function for personal mode:
   if  [ ! -e $F ] ; then
      #If defcon file does not exist, create and source it.
      mkdir -p $D
      #Set patterns
      local -a a_P=($(grep -Eno "$P" $S|cut -d":" -f1))
      tail -n+$((${a_P[0]}+1)) $S|head -$((${a_P[1]} - $((${a_P[0]}+1)))) > $F
      chmod 644 $F
      . $F
   elif [ -r $F ] ; then
      . $F
   else
      chmod 644 $F
      . $F
   fi
   case $@ in
      *--editd*)
      echo "--------------------------------------------------"
      echo "Tap Enter to edit the defcon file for this script."
      echo "--------------------------------------------------"
      read -s -t 10 -n 1
      # If a search pattern was *ALSO PASSED* to defcon, along with the edit
      # Jump to a specific spot if 
      if [ ! -z $3 ] ; then
         V=+/$3
      fi
      vim -c 'sy on' \
          -c ':set syntax=sh' \
          $V \
          $F
      #Exit script if edit option was passed
      exit
      ;;
   esac
}
extract_source_items_and_set_sidir (){
   # Takes 1 arg:       Arg 1 is an (optional) source code item to extract
